Jessie Lee is not enjoying her college experience. She\'s stuck at a notoriously preppy campus and has a roommate she doesn\'t like (Andy San Dimas). However, once Jessie discovers that joining the Student Council and getting around on campus could result in her favorite band - Blackleg - playing at the school, things take a drastic turn. Jessie transforms from a disgruntled coed slut into...well...a motivated coed slut. With enough signatures on her concert petition and some undergraduate cock-blowing along the way, Jessie Lee makes college a whole lot more fun.
